issue.body:
fix https://github.com/goplus/c2go/issues/180
- support e.g. 1+2i 
```
IntegralRealToComplex
```

fix https://github.com/goplus/c2go/issues/178
- support to boolean 
```
IntegralToBoolean
FloatingToBoolean
FloatingComplexToBoolean
IntegralComplexToBoolean
PointerToBoolean
```
e.g.
```
#include <stdio.h>
#include <stdbool.h>

void chk(bool b){
    printf("%d\n",b);
}

int main() {
	char *p;
	chk(1 == 1);
	chk(1);
	chk(1.0);
	chk(1+2i);
	chk(1+2.0i);
	chk(p);
        return 0;
}
```
c2go
```
func _cgo_main() int32 {
	var p *int8
	chk(int32(1) == int32(1))
	chk(int32(1) != 0)
	chk(1.0 != 0.0)
	chk(complex128(int32(1))+2i != 0.0)
	chk(complex128(float64(int32(1)))+2i != 0.0)
	chk(p != nil)
	return int32(0)
}
```

